import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';
import leftPanel from './left-panel';


const style = {
    paper: {
        padding : "15px",
        margin : "10px",
        marginBottom : "10px"
    }
}

export default function Content() {
    return (
        <Grid container>

            <leftPanel styles = {style}/>
            <RightPanel styles = {style}/>



        </Grid>
    )
}
